// App.tsx or your parent component

import React, { useState } from 'react';
import AddEditUser from './AddEditUser'; // your component

const Userlist = () => {
  const [modelName, setModelName] = useState({ name: '', id: null });

  const onCloseModal = () => {
    setModelName({ name: '', id: null });
  };

  return (
    <div className="container mt-4">
      <button
        className="btn btn-primary"
        onClick={() => setModelName({ name: 'AddEditUser', id: 0 })}
      >
        Add
      </button>

      {modelName.name === 'AddEditUser' && (
        <AddEditUser
          show={true}
          handleClose={onCloseModal}
          modalData={modelName}
          id={modelName.id}
        />
      )}
    </div>
  );
}

export default Userlist;
